The @jacobandco Astronomia Dragon Art Mother of Pearl is a truly out of this world design, featuring an 18k gold dragon with rubies as eyes and the base dial of made of mother-of-pearl.

For the Astronomia Collection, Jacob & Co. has taken the tourbillon one step farther, introducing additional axes in which the tourbillon turns. For this Astronomia Art, the tourbillon is double-axis - turning in two axes: one in 60 seconds and the second in 2.5 minutes.

@jacobandco combines high art aswell as high watchmaking with the Asrtonomia Dragon Art Mother of Pearl.
